<script setup>
import { nextTick, onMounted, watch, ref } from 'vue'
import { useUserStore } from '@/store/user'
import { storeToRefs } from 'pinia'

// eslint-disable-next-line no-undef
const emit = defineEmits(['continue', 'question', 'skip'])
const user = useUserStore()
const { userName } = storeToRefs(user)
const replicStep = ref(0)
const replicStepAskWaiting = ref(false)

let text1
let text2

watch(replicStep, (value) => {
    switch (value) {
        case 1:
            replicStepAskWaiting.value = true
            emit('question')
            break;

        case 2:
            text1.classList.remove('visible')
            text2.classList.add('visible')
            break;

        case 3:
            text2.classList.remove('visible')
            emit('continue')
            break;

        default:
            break;
    }
})

const nextStep = () => {
    replicStepAskWaiting.value = false
    replicStep.value += 1
}

onMounted(async () => {
    await nextTick()
    emit('skip')
    document.addEventListener('nextReplic', () => {
        if (replicStepAskWaiting.value === true) return 
        replicStep.value += 1
    })

    text1 = document.querySelector('#text-91')
    text2 = document.querySelector('#text-92')
    
    setTimeout(() => {
        text1.classList.add('visible')
    }, 500)
})

// eslint-disable-next-line no-undef
defineExpose({
    nextStep
})
</script>

